import { useState } from "react";

const Todo = (props) => {

  function deleteHandler(){
    console.log('clicked!');
    console.log(props.text);
}

  return (
    <div className='card'>
        <h2>{props.text}</h2>
        <div className='actions'>
          <button onClick={deleteHandler} className='btn' >Delete</button>
        </div>
      </div>
  )
}

export default Todo
